const MM = 100;
const mm = 1;

function dn(x)
{
	y = x * (MM - mm) + mm;
	return y;
}

const config = {
  
  hiddenLayers: [32,32,32,16], // array of ints for the sizes of the hidden layers in the network
  activation: 'sigmoid' // supported activation types: ['sigmoid', 'relu', 'leaky-relu', 'tanh']
};

var net = new brain.NeuralNetwork(config);
net.fromJSON(JSON.parse(jnn));

var net2 = null;
if(jnn2 != null)
{
	net2 = new brain.NeuralNetwork(config);
	net2.fromJSON(JSON.parse(jnn2));
}

console.log("ok");

function norm(x)
{
	return (x - mm) / (MM - mm);
}
var good_cnt = 0;

var bad1_cnt = 0;
var bad_cnt = 0;
var data = [];

function getPrediction(input)
{
	var bn = net.run(input);
	if(net2 != null)
	{
		var test = testEllipse(1, input[0], input[1], input[2], input[3], bn[0], dn(bn[1]));
		if(test >= 1)
		{
			bad1_cnt++;
			bn = net2.run(input);
		}
	}
	return bn;
}

function getBN(sf,x_tgt)
{
	window.rotateObstacle = false;
	var input = [norm(window.Vars.obstacle.x_up * sf), norm(window.Vars.obstacle.y_up * sf), norm(window.Vars.obstacle.x_down * sf), norm(window.Vars.obstacle.y_down * sf)];
	
	var bn = getPrediction(input);
	
	var dp = null;
	
	if(bn[0] < 0 || bn[1] < 0)
	{
		console.log("tough luck");
	}

	var test = testEllipse(1, input[0], input[1], input[2], input[3], bn[0], dn(bn[1]));	
	
	bn[0] = dn(bn[0]);
	bn[1] = dn(bn[1]);	
	//test = 1;
	if(test >= 1)
	{
		var bn1 = ellipseParams(100, dn(input[0]), dn(input[1]), dn(input[2]), dn(input[3]));
		bn = bn1;
		
		dp = {input: [input[0].toFixed(3),input[1].toFixed(3),input[2].toFixed(3),input[3].toFixed(3)], output: [norm(bn[0]).toFixed(3),norm(bn[1]).toFixed(4)]}
		data.push(dp);
		
		bad_cnt++;
		console.log("good_count=" +good_cnt + ", bad_count=" + bad_cnt + " (" + (100 * bad_cnt / (bad_cnt + good_cnt)).toFixed(2) + ")");
		console.log(((Vars.obstacle.dist - Vars.obstacle.y_down) / Vars.obstacle.dist).toFixed(3));
	}
	else
	{
		good_cnt++;
	}
	bn[0] = bn[0] / sf;
	
	window.rotateObstacle = true;
	return bn;
}

var total_path = 0;
var smoothness = 0;
function tallyPath(orig, tgt)
{
	var d = Math.sqrt(Math.pow((tgt.x - orig.x),2) + Math.pow((tgt.y - orig.y),2) + Math.pow((tgt.z - orig.z),2));
	total_path += (100 * d) / (window.Vars.obstacle.dist + window.Vars.obstacle.perimeter);
	smoothness += Math.asin(Math.abs(tgt.z - orig.z) / d);
}

var total_time = 0;
async function moveToOD(Params, Vars, tgt)
{
	await timeout(50);
		if(window.Vars.obstacle == null)
		{
			await driveTo(Params, Vars, tgt);
			return;		
		}	

		var pointCloud = null;
		
		var cur_x = parseFloat($("#x").val() + "");
		var cur_y = parseFloat($("#y").val() + "");
		var cur_z = parseFloat($("#z").val() + "");
		var cur_rx = parseFloat($("#rx").val() + "");
		var cur_ry = parseFloat($("#ry").val() + "");
		var cur_rz = parseFloat($("#rz").val() + "");
		
		var increment_x = (tgt.tcp.x - cur_x) / 101;
		var increment_y = (tgt.tcp.y - cur_y) / 101;
		var increment_z = (tgt.tcp.z - cur_z) / 101;
		
		var max_z = Vars.obstacle.y_up;
		
		var sf = 100 / window.Vars.obstacle.dist;
		
		//var points = generateEllipsePoints(100,bn[0],bn[1]);
		var x_tgt = 100;
		
		var bn = getBN(sf,x_tgt);
		
		var points = [];
		
		for(var i=0;i<101;i++)
		{
			var target = {tcp: {}};
			target.tcp.x = cur_x + (i + 1) * increment_x;
			target.tcp.y = cur_y + (i + 1) * increment_y;

			var old_bn = bn;

			if(window.Vars.obstacle != null) 
				//&& (i / sf) <= window.Vars.obstacle.x_down)
			{
				var d = new Date();
				var start_time = d.getTime();
				
				bn = getBN(sf,x_tgt);				
				
				d = new Date();
				var stop_time = d.getTime();
				total_time += stop_time - start_time;
			}

			//var b = (bn[0] + old_bn[0]) / 2;
			//var n = (bn[1] + old_bn[1]) / 2;
			
			var b = bn[0];
			var n = bn[1];
			
			
			var x = i - 50;
			var a = x_tgt / 2;
			
			
			
			var ey = b * Math.pow(1 - Math.pow(Math.abs(x / a), n), 1/n);
			
			target.tcp.z = cur_z + ey + (i + 1) * increment_z;
			
			target.tcp.rx = cur_rx;
			target.tcp.ry = cur_ry;
			target.tcp.rz = cur_rz;
			
			
			tallyPath(Robot.tcp,target.tcp);
			
			
			const material = new THREE.MeshBasicMaterial( {color: 0x000000} );
			var geometry = new THREE.SphereGeometry( 0.02, 0.02, 0.02 );
			var sphere = new THREE.Mesh( geometry, material );
			sphere.position.set(target.tcp.x / 100,target.tcp.y / 100,(target.tcp.z - 80) / 100);
			window.scene.add( sphere );
			points.push(sphere);
			
			if(i % 2 != 0) continue;
				
			
			if(i < 100) 
			{
				await driveTo(Params, Vars, target);
			}
			else
			{
				await driveTo(Params, Vars, tgt);
			}
		}		
		
		
		Robot.origin = null;
		var pnts = [...points];
		setTimeout(function() {
			for(var i=0; i<pnts.length; i++)
			{
				window.scene.remove(pnts[i]);
			}
		}, 5000);
		
}
